(852, '吉川モータース', '', '', '', '', 'http://www18.ocn.ne.jp/~kms/', 'kashima_yoshiaki@rivercrane.com', NULL, 'HONDA車を中心として各社メーカーを取り扱うバイク専門店です。\r\n原付バイク、大型バイクを問わず新車のお取り扱いおよび整備,修理を行っております。整備場には大型車をつり下げる事の出来る設備を備え、大型重量車の整備なども安全に素早く作業を行うことが可能となっております。\r\n吉川モータースでは、よりリーズナブルにバイクを所有したいというお客様のために優良中古車も取り扱っております。是非ご来店いただき実車を確認の上、納得ゆくまでご質問くださいませ', '0210876', '岩手県', 3, '一関市', '字広街２−６', '0191-23-5409', '', '141.131395', '38.924178', 'shop852_img1.gif', 'shop852_img1.gif', NULL, 1, 'kashima', '2012-04-23 01:26:02', 1, NULL, NULL, '4e243259e17b4', 'ショップからのコメント', 'HONDA車を中心として各社メーカーを取り扱うバイク専門店です。\r\n原付バイク、大型バイクを問わず新車のお取り扱いおよび整備,修理を行っております。整備場には大型車をつり下げる事の出来る設備を備え、大型重量車の整備なども安全に素早く作業を行うことが可能となっております。\r\n吉川モータースでは、よりリーズナブルにバイクを所有したいというお客様のために優良中古車も取り扱っております。是非ご来店いただき実車を確認の上、納得ゆくまでご質問くださいませ', '', '', '', '', '', '', '', 'http://kms.blog.ocn.ne.jp/weekly/', 'http://kms.blog.ocn.ne.jp/weekly/rss.xml', '0', 'U', NULL, NULL, NULL, '8900223'),
