(858, 'クレイジーモーターサイクル', '', '1030', '1930', '毎週水曜日、イベント日（不定）', 'http://www.mc-crazy.com/', 'kashima_yoshiaki@rivercrane.com', NULL, '北上市から移転しました。\r\nタイヤ販売、車検対応など皆様のバイクライフの手助けをさせていただきます。\r\nどうぞヨロシク。\r\n今更CB400SFのオリジナルパーツの販売開始しました。\r\n次はCB1100でやりたいですね！\r\n\r\n', '0230841', '岩手県', 3, '奥州市', '水沢区真城字畑ヶ田９１', '0197-26-5056', '0197-26-5056', '141.15438759326935', '39.10798857334258', NULL, '', NULL, 1, 'kashima', '2012-10-26 02:27:14', 1, NULL, NULL, '4e1ed25569366', '当社オリジナルパーツについて', 'タイヤ販売、車検対応など皆様のバイクライフの手助けをさせていただきます。<br><br>今更CB400SF(NC31)のオリジナル外装パーツの販売開始しました。<br>ポン付けでCB750F風に変身します。<br>一般の車検もok！レース車検もok！です。<br>（現在Taste of Tsukuba ZERO-4クラス参戦中です）<br><br>', 'shop_858_1.jpg', '新規開発製品情報', 'HONDA縦型APE100エンジンのクランクケースのセンターガスケットを0.50mm鋼板でレーザーカッティングしました。<br>組付時のケース剛性・均熱・精度向上に役立つ製品です。<br>横型エンジン用も販売開始しました。<br>特に横型エンジンでは腰下の音が小さくなるという声が上がってきましたが、「あなたの組み方が上手なんですよ」と言葉を濁しております。<br>', 'shop_858_2.jpg', 'GPZ900Rパーツ開発中', 'GPZ900Rの強化エンジンマウント製作テスト中です。<br>2012シーズン販売開始予定です。', '', 'http://blogs.yahoo.co.jp/beater01jp', 'http://blogs.yahoo.co.jp/beater01jp/rss.xml', 'Z1', 'C', 'MM1', 'C', '3', NULL),
