(1645, 2948, 1, 43, '', '', 2, 1, 350000, 1.0, 10000, 3500, NULL, 733, 0, '2009年04月', 50, NULL, '紺/白', '１２Ｖ・88cc？エンジン・武川パーツ⇒ ステムSET・Frフォーク・ディスクKIT・アルミライトステー・Frカーボンフェンダー・ロングスイングアーム・RrフローティングディスクKIT・10インチアルミホイール前後・TMキャブレター・マニホールド・ハイスロＫＩＴ・バックステップ・ダウンマフラー・ハンドル・140Kmスピードメーター・カヤバＲｒショック・Rｒメッシュホース・他\r\n☆現状販売（登録・整備無し）致します。\r\n★通信販売を御希望のお客様へ ・　保証について（よくお読み下さい。）\r\n注意事項 当社では当社規定箇所の点検・整備後、試乗を行い充分に車両の確認を行ってから発送していますが、ごくまれにオーバーフロー（注1）、電装類の接触不良、お客様のエンジン始動時のミス、取り扱いのミスや、又はガス欠（注2）等、予想出来ない不具合をおこす事が有りえますが、当店でお客様の所に伺い修理をする事は出来ませんので御了承下さい。　（電話やメールで、修理のアドバイスは致します。）\r\nお客様にはリスクになりますが、中古車及び旧車の為、現状販売のノークレーム（注3）・ノーリターン（注４）でお願い致しております。\r\n当社は平成元年より18年間、専門雑誌広告で全国通信販売をメインに営業致しております。意図的に、粗悪車を売るつもりは一切御座いませんので、ご安心下さい。高い買い物ですから後々のトラブルを避ける為、出来る限り現車確認して下さい。（外見の綺麗・汚い、音の良い・悪い等は、人それぞれ感覚が違います。）\r\n尚、当社まで車両を搬入出来るお客様には１ヶ月に付き１万円で最長3ヶ月の保証（注5）が付けられますので、御検討下さい。\r\n※（注1）ガソリンの中の小さなゴミや錆がキャブレターの中に詰まり、ガソリンがあふれ出る事。\r\n※（注2）ガソリンが無い事。けっこう多いのが、これです！\r\n※（注3）保証無しです。\r\n※（注4）返品無しです。\r\n※（注5）保証内容の詳細は別途請求下さい。 \r\n', 0, 0, 0, NULL, '', 0, 0, '00', 0, '20091220190259_2948_80_1.jpg', NULL, '20091220190259_2948_80_2.jpg', NULL, '20091220190259_2948_80_3.jpg', NULL, '20091220190259_2948_80_4.jpg', NULL, '20091220190259_2948_80_5.jpg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, NULL, '2011-07-19 14:53:54', 'sys_err5', '2012-06-25 21:47:07'),
