(2359, 15344, 2, 1557, '', '', 3, 1, NULL, 1.0, 10000, 0, NULL, NULL, 0, '', 250, NULL, '青', 'ＳＡＩＳＥＩでは初心者、キッズ、女性の\r\n人でも気軽にモトクロスを体験できる、\r\n「モトクロス　レンタル体験走行会」を\r\n随時開催してます。\r\nもちろん昔、モトクロスをしていた、\r\nリターンライダーの参加も大歓迎。\r\n\r\nレンタルバイクは５０ｃｃから２５０ｃｃ\r\nまで、６車種を用意しているので、\r\nお目当ての車種を試乗してみたい\r\nという人もＯＫ。\r\n道具はなにも不要です｡\r\n「モトクロスに乗りたい気持ちだけ」\r\n持って､ご来店ください。\r\n\r\n参加お申し込み方法も簡単\r\nまずはお電話、メールでお客様のご希望の\r\n日程、参加人数、バイク車種、ウェアー等\r\nのサイズ等などお問い合わせ下さい。\r\n　　　　　　　↓\r\n申込書をお送りいたしますので必要事項を\r\nご記入し、捺印をしていただいて\r\nご返送下さい。 \r\n　　　　　　　↓\r\n申込書を確認し日程が決まりましたら、\r\nお客様へご連絡いたします。\r\n　　　　　　　↓\r\nこれで申込手続きは完了です。\r\nあとは開催日を待つだけ。\r\n\r\n※各コースの貸し切りの確認、日程調整\r\n　などが必要になりますのでお問い合わせ\r\n　は開催希望日の３週間前までにお願いし\r\n　ます。\r\n\r\n参加費\r\n１０，０００円＋コース走行料\r\n\r\nコース走行料\r\nウッズモータスポーツランド３，０００円 \r\nチキンランド２，５００円\r\n\r\n※レンタルバイクは台数に限りがございま\r\n　すので予定台数に達していた場合は\r\n　ご了承下さい。\r\n※小学生以下のお子様の参加は保護者様\r\n　ご同伴での参加をお願いいたします。\r\n\r\n開催予定地\r\nウッズモータースポーツランド（奈良県）\r\n　（初心者用ミニコース有）\r\n　　月〜日曜日開催可能\r\nチキンランド（京都府）\r\n　　土、日曜日、祝日のみ開催可能', 0, 0, 0, NULL, '', 0, 0, '00', NULL, '20100809152239_15344_10_1.jpg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, NULL, '2011-07-19 14:53:54', 'sys_err5', '2012-06-25 21:47:07'),
