(2391, 15437, 2, 932, '', '', 2, 1, 660000, 1.0, 10000, 6600, NULL, 5809, 0, '', 250, NULL, '白・手描きペイント', '■マグザム限定フルカスタム車\r\n■外装カウル：手描きペイント、世界に一台\r\n■インナー：大理石調ペイント\r\n■ワイズギア製ブルーミラー新品\r\n■ワイズギア製メッキパーキングレバー新品\r\n■デイトナ製クロームメッキマスターシリンダー左右新品\r\n■デイトナ製クロームメッキコントロールスイッチ新品\r\n■キタコ製フロントフォークメッキカバー新品\r\n■アルミグリップ新品\r\n■カスタムワイドハンドル装着 \r\n■アルミステップ新品\r\n■オリジナルカスタムシーシーバー装着\r\n■オリジナルカスタムマフラー新品\r\n■カスタムダイアカットシート新品\r\n■オリジナルクランクケースカバー新品\r\n\r\n■現物の迫力が、写真ではダイレクトに伝わらないのが残念です\r\n■とにかく圧巻！どこに行っても、目立ち度満点です\r\n■手描きペイントは芸術の域です\r\n■機関良好！整備を済ませまして納車いたします\r\n■注：外装手描きペイントは、目立つ傷・凹み等ありませんが、インナーの大理石調ペイント端部にペイントの剥げが見受けられます\r\n当方の見解ですが、暫くは現状でお乗りになり、将来は、インナーのみ新たにペイントされれば良いと思います \r\n■他・・・新品カスタム多数\r\n\r\n●待望マグザムの笹谷バージョン登場です\r\n●今後、次々に登場いたしますが、初回デビュー作は世界に１台のコンプリートで決めました\r\n●このマグだったら冬の寒さもぶっ飛びます\r\n\r\n★市場販売価格￥900,000以上を限定価格￥660,000\r\n☆業界最安値のプライスで販売いたします\r\n★当店では整備料・登録諸費用は無料です\r\n★乗り出し価格￥660,000以上の他にお金は一切受け取りません。\r\n★只今、ご成約のお客様には、自賠責保険料を全額、当方が負担いたします\r\n★全国納車可能 \r\n■北海道〜沖縄まで全国配送無料キャンペーン中！\r\n\r\n■笹谷パーツ■\r\n\r\n〒351-0112\r\n\r\n埼玉県和光市丸山台2-2\r\n\r\nTEL 0120-925-338\r\n【お知らせ】\r\n現在、東北地方太平洋沖地震の影響により、計画停電が実施されておりまして、\r\nカスタム車の組み上げ作業に支障・遅れが生じております。\r\nお客様の納車を約束通りにするために昼夜、スタッフ一同作業しておりまして、\r\nなかなか電話に出れません。\r\nまた停電中は、電話回線も繋がらなく、電気が復旧しても混線で繋がらない事例もあります。\r\n大変恐れ入りますが、車両に関するお問い合わせは、当HPの「お問合せ先」より、\r\nメールでお願いいたします。\r\n電話で直接、詳細を、お聞きなりたい方は、連絡先と都合がいい時間帯を、記入していただけましたら、\r\n当方より、お電話差し上げます。\r\n \r\n笹谷パーツPC\r\nhttp://www.ssy338.com\r\n \r\n笹谷パーツモバイル\r\nhttp://my.peps.jp/sa2901\r\n \r\n※当方のカスタム車製作は、フレーム・エンジンの状態から、一つ一つのパーツを組み上げており、\r\nまた、エンジン・クランクのO/H作業も多く、二人で作業することも多いため、電話があれば、\r\n必然的に作業を中断することになり、遅れが生じます。\r\n少人数で作業してますので、何卒、わがままを、お許し願います。\r\nまた、電話でカスタム依頼を受けた場合、双方の聞き違い等により、カスタム車が完成しても、\r\nお客様のご要望通りになっていない場合があります。\r\nメールでしたら、常にお客様からのオーダーを確認できますので、間違いが無い作業ができます。\r\nよろしく、ご協力願います。\r\n\r\n営業時間AM11:00〜PM20:00', 0, 0, 0, NULL, '', 0, 0, '00', 0, '20071121151648_15437_31_1.jpg', NULL, '20071121151648_15437_31_2.jpg', NULL, '20071121151648_15437_31_3.jpg', NULL, '20071121151648_15437_31_4.jpg', NULL, '20071121151648_15437_31_5.jpg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, NULL, '2011-07-19 14:53:54', 'sys_err5', '2012-06-25 21:47:07'),
