(2458, 15437, 2, 811, '', '', 2, 1, 680000, 1.0, 10000, 6800, NULL, 7229, 0, '', 250, NULL, '黒・赤', '■フロントエアロマスク・リアウィング・・・他エアロパーツ一式装着\r\n■特注ラグジュアリーシート新品\r\n■極太タンデムファットバー新品\r\n■ステップボード新品\r\n■ローダウンショック装着\r\n■カスタム左右ダブルエアクリーナー新品\r\n■カスタムかち上げマフラー新品\r\n■クランクケースカバー新品\r\n■フロントフォークカバー新品\r\n■アルミグリップ新品 \r\n■アルミハンドル新品\r\n■ワイドハンドルポスト新品\r\n■リアサスダウンブラケット装着\r\n■フェンダーレスキット新品\r\n■他・・・新品カスタム多数 \r\n\r\n■今回、インナーに新色の「ハイパーレッド」でペイント\r\n■マフラーは、笹谷パーツお家芸カチアゲマフラー健在です\r\n■重低音で存在感ある音質を是非、ご来店の上、お聞きください \r\n■このグラマジェに冬はありません！初詣！視線の痛みに耐えれますか？\r\nバックボーンCFアルミダイキャストで高速走行も余裕です\r\n是非、ご来店の上、じっくりと見てください\r\n\r\n★市場販売価格￥900,000を限定価格￥680,000\r\n★当店では整備料・登録諸費用は０円です\r\n★乗り出し価格￥680,000の他にお金は一切受け取りません。\r\n★只今、ご成約のお客様には自賠責保険は当方がご負担いたします\r\n★全国納車可能（北海道から沖縄まで配送無料キャンペーン中） \r\n\r\n■笹谷パーツ■\r\n\r\n〒351-0112\r\n\r\n埼玉県和光市丸山台2-2\r\n\r\nTEL 0120-925-338\r\n【お知らせ】\r\n現在、東北地方太平洋沖地震の影響により、計画停電が実施されておりまして、\r\nカスタム車の組み上げ作業に支障・遅れが生じております。\r\nお客様の納車を約束通りにするために昼夜、スタッフ一同作業しておりまして、\r\nなかなか電話に出れません。\r\nまた停電中は、電話回線も繋がらなく、電気が復旧しても混線で繋がらない事例もあります。\r\n大変恐れ入りますが、車両に関するお問い合わせは、当HPの「お問合せ先」より、\r\nメールでお願いいたします。\r\n電話で直接、詳細を、お聞きなりたい方は、連絡先と都合がいい時間帯を、記入していただけましたら、\r\n当方より、お電話差し上げます。\r\n \r\n笹谷パーツPC\r\nhttp://www.ssy338.com\r\n \r\n笹谷パーツモバイル\r\nhttp://my.peps.jp/sa2901\r\n \r\n※当方のカスタム車製作は、フレーム・エンジンの状態から、一つ一つのパーツを組み上げており、\r\nまた、エンジン・クランクのO/H作業も多く、二人で作業することも多いため、電話があれば、\r\n必然的に作業を中断することになり、遅れが生じます。\r\n少人数で作業してますので、何卒、わがままを、お許し願います。\r\nまた、電話でカスタム依頼を受けた場合、双方の聞き違い等により、カスタム車が完成しても、\r\nお客様のご要望通りになっていない場合があります。\r\nメールでしたら、常にお客様からのオーダーを確認できますので、間違いが無い作業ができます。\r\nよろしく、ご協力願います。\r\n\r\n営業時間AM11:00〜PM20:00', 0, 0, 0, NULL, '', 0, 0, '00', 0, '20071217135807_15437_32_1.jpg', NULL, '20071217135807_15437_32_2.jpg', NULL, '20071217135807_15437_32_3.jpg', NULL, '20071217135807_15437_32_4.jpg', NULL, '20071217135807_15437_32_5.jpg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, NULL, '2011-07-19 14:53:54', 'sys_err5', '2012-06-25 21:47:07'),
