(2590, 15437, 1, 177, '', '', 2, 1, 480000, 1.0, 10000, 4800, NULL, 5189, 0, '', 250, NULL, '白', '■外装カウル全塗装済み\r\n■インナーペイント鏡面仕上げ\r\n■特注ソファシート新品\r\n■クロームメッキホイール新品\r\n■クロームサイドバイザー新品\r\n■クロームピボットカバー新品\r\n■フロントクリスタルユーロレンズ新品\r\n■ハンドルセッター新品\r\n■カスタムナローアルミハンドル新品\r\n■カスタムグリップ新品 \r\n■クロームメッキ右マスターシリンダー新品\r\n■左右タンデムグリップ新品\r\n■ステップボード新品\r\n■ローダウンフロントショック新品\r\n■ローダウンリアショック新品\r\n■ショートサイドスタンド装着\r\n■メッキスタンド装着\r\n■カスタムマフラー新品\r\n■クロームプーリーケースカバー新品\r\n■リアウィングイルミネーションランプ新品 \r\n■クリアユーロテール新品\r\n●当方は高年式車のみをベースにカスタムしますので\r\nエンジン周りはご安心ください\r\n★市場価格、約￥700,000以上を特別価格￥480,000で販売\r\n★この装備でこの価格、世界一安いです\r\n★当店では整備料・登録諸費用は０円です\r\n★￥480,000の他にお金は一切受け取りません。\r\n★只今、ご成約のお客様には、自賠責保険料を全額、当方が負担いたします\r\n★全国納車可能（北海道から沖縄まで発送無料キャンペーン中）\r\n\r\n■笹谷パーツ■\r\n\r\n〒351-0112\r\n\r\n埼玉県和光市丸山台2-2\r\n\r\nTEL 0120-925-338\r\n【お知らせ】\r\n現在、東北地方太平洋沖地震の影響により、計画停電が実施されておりまして、\r\nカスタム車の組み上げ作業に支障・遅れが生じております。\r\nお客様の納車を約束通りにするために昼夜、スタッフ一同作業しておりまして、\r\nなかなか電話に出れません。\r\nまた停電中は、電話回線も繋がらなく、電気が復旧しても混線で繋がらない事例もあります。\r\n大変恐れ入りますが、車両に関するお問い合わせは、当HPの「お問合せ先」より、\r\nメールでお願いいたします。\r\n電話で直接、詳細を、お聞きなりたい方は、連絡先と都合がいい時間帯を、記入していただけましたら、\r\n当方より、お電話差し上げます。\r\n \r\n笹谷パーツPC\r\nhttp://www.ssy338.com\r\n \r\n笹谷パーツモバイル\r\nhttp://my.peps.jp/sa2901\r\n \r\n※当方のカスタム車製作は、フレーム・エンジンの状態から、一つ一つのパーツを組み上げており、\r\nまた、エンジン・クランクのO/H作業も多く、二人で作業することも多いため、電話があれば、\r\n必然的に作業を中断することになり、遅れが生じます。\r\n少人数で作業してますので、何卒、わがままを、お許し願います。\r\nまた、電話でカスタム依頼を受けた場合、双方の聞き違い等により、カスタム車が完成しても、\r\nお客様のご要望通りになっていない場合があります。\r\nメールでしたら、常にお客様からのオーダーを確認できますので、間違いが無い作業ができます。\r\nよろしく、ご協力願います。\r\n\r\n営業時間AM11:00〜PM20:00', 0, 0, 0, NULL, '', 0, 0, '00', 0, '20080111231246_15437_36_1.jpg', NULL, '20080111231246_15437_36_2.jpg', NULL, '20080111231246_15437_36_3.jpg', NULL, '20080111231246_15437_36_4.jpg', NULL, '20080111231246_15437_36_5.jpg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, NULL, '2011-07-19 14:53:54', 'sys_err5', '2012-06-25 21:47:07'),
