(2767, 15685, 2, 700, '', '', 2, 1, 48000, 1.0, 10000, 480, NULL, 3970, 0, '', 50, NULL, '黒', '保証は有りませんが、初期不良,クレーム対応致します\r\n通勤・通学におすすめ、試乗しました、発進、加速共に調子良いです、人気の3KJジョグです、タイヤは後6分山くらい、前は8分山くらいです、バッテリーは元気です、セルで始動します、メットインタイプ、外観は擦り傷なども少なく、そこそこ綺麗です、全体をバラしてから、整備しながら組み立てています、もちろんキャブレターも掃除済みです、ミッションケース内もオーバーホールしています、2サイクルエンジンでキビキビ走ります、 保証は有りませんが、状態B以上の、基本整備(整備内容、参照)に近い整備しています。購入後、1ヶ月又は300Km走行までに発生した、初期不良クレーム対応致します。走行距離はメーター読みです、当店は対面販売のみの対応となります。', 0, 0, 0, NULL, '', 0, 0, '00', 0, '20091022123309_15685_92_1.jpg', NULL, '20091022123309_15685_92_2.jpg', NULL, '20091022123309_15685_92_3.jpg', NULL, '20091022123309_15685_92_4.jpg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, NULL, '2011-07-19 14:53:54', 'sys_err5', '2012-06-25 21:47:07'),
