(2786, 15437, 2, 932, '', '', 2, 1, 580000, 1.0, 10000, 5800, 2006, 4916, 0, '', 250, NULL, 'ベリーダークバイオレットメタリッ', '■マグザム限定フルカスタム車！第二弾！\r\n■純正カウルカラー：ベリーダークバイオレットメタリック\r\n■アップハンドル装着\r\n■クロームメッキコントロールスイッチ装着\r\n■メッキパーキングレバー装着\r\n■クロームメッキマスターシリンダー左右装着\r\n■ステンメッシュブレーキホース装着\r\n■ステンメッシュスロットルケーブル装着\r\n■ステンメッシュパーキングケーブル装着\r\n■ステンレス製フロントフォーク装着\r\n■ビレットクロームグリップ装着\r\n■ローダウンフロントフォーク装着\r\n■ローダウンリヤショック装着\r\n■アルミ削り出しクロームメッキステム装着\r\n■笹谷パーツ製アルミステップ新品\r\n■笹谷パーツ製メッキクランクケースカバー新品\r\n■笹谷パーツ製ジェットマフラー新品\r\n\r\n■笹谷パーツプレゼンツ第二弾！\r\n■ズバリ、極上のマグザムです\r\n■純正色カウル・純正インナー、しかも傷も見当たらなく程度上！\r\n■走行距離も少なく機関良好！整備を済ませまして納車いたします\r\n■カスタム通なら一目瞭然！仕様パーツが違います！\r\n■ローダウン車ですが、上質のサスで乗り心地も最高車\r\n■他・・・新品カスタム多数\r\n\r\n●羊の皮を被った狼！この春に如何ですか？マグをお探しの方、沢山、他店を覗いて、最後に笹谷プロデュースのマグと比べてください。装備・価格の違いに驚くでしょう！\r\n\r\n★市場販売価格￥800,000以上を限定価格￥580,000\r\n☆業界最安値のプライス！何故か？それはパーツ製造・販売元だからです\r\n★当店では整備料・登録諸費用は無料です\r\n★乗り出し価格￥580,000以上の他にお金は一切受け取りません。\r\n★只今、ご成約のお客様には、自賠責保険料を全額、当方が負担いたします\r\n★全国納車可能（北海道から沖縄まで配送無料キャンペーン中）\r\n\r\n■笹谷パーツ■\r\n\r\n〒351-0112\r\n\r\n埼玉県和光市丸山台2-2\r\n\r\nTEL 0120-925-338\r\n\r\n【お知らせ】\r\n現在、東北地方太平洋沖地震の影響により、計画停電が実施されておりまして、\r\nカスタム車の組み上げ作業に支障・遅れが生じております。\r\nお客様の納車を約束通りにするために昼夜、スタッフ一同作業しておりまして、\r\nなかなか電話に出れません。\r\nまた停電中は、電話回線も繋がらなく、電気が復旧しても混線で繋がらない事例もあります。\r\n大変恐れ入りますが、車両に関するお問い合わせは、当HPの「お問合せ先」より、\r\nメールでお願いいたします。\r\n電話で直接、詳細を、お聞きなりたい方は、連絡先と都合がいい時間帯を、記入していただけましたら、\r\n当方より、お電話差し上げます。\r\n \r\n笹谷パーツPC\r\nhttp://www.ssy338.com\r\n \r\n笹谷パーツモバイル\r\nhttp://my.peps.jp/sa2901\r\n \r\n※当方のカスタム車製作は、フレーム・エンジンの状態から、一つ一つのパーツを組み上げており、\r\nまた、エンジン・クランクのO/H作業も多く、二人で作業することも多いため、電話があれば、\r\n必然的に作業を中断することになり、遅れが生じます。\r\n少人数で作業してますので、何卒、わがままを、お許し願います。\r\nまた、電話でカスタム依頼を受けた場合、双方の聞き違い等により、カスタム車が完成しても、\r\nお客様のご要望通りになっていない場合があります。\r\nメールでしたら、常にお客様からのオーダーを確認できますので、間違いが無い作業ができます。\r\nよろしく、ご協力願います。\r\n\r\n営業時間AM11:00〜PM20:00', 0, 0, 0, NULL, '', 0, 0, '00', 0, '20080301184020_15437_38_1.jpg', NULL, '20080301184020_15437_38_2.jpg', NULL, '20080301184020_15437_38_3.jpg', NULL, '20080301184020_15437_38_4.jpg', NULL, '20080301184020_15437_38_5.jpg', NULL, N