(2844, 15437, 2, 932, '', '', 2, 1, 560000, 1.0, 10000, 5600, 2006, 4416, 0, '', 250, NULL, '黒', '☆全身フルカスタム車\r\n\r\n☆カスタム内容\r\n\r\n\r\n\r\n■マグザムSASAYAversion-01誕生！\r\n\r\n■カラー：ブラック\r\n\r\n■特注エナメルダイヤカットシート新品\r\n\r\n■特注エナメルダイヤカットバックレストカバー新品\r\n\r\n■プロジェクター＆LEDコンビネーションヘッドライト新品\r\n\r\n■LEDクリアテール新品\r\n\r\n■LEDクリアウィンカーフロント＆リア新品\r\n\r\n■アルミナローハンドルバー新品\r\n\r\n■ビレットハンドルホルダーカバー新品\r\n\r\n■ビレットクロームグリップ新品\r\n\r\n■フロントフォークカバー新品（納車時取付）\r\n\r\n■アルミステップボード新品\r\n\r\n■メッキクランクケースカバー新品\r\n\r\n■ジェットマフラー新品\r\n\r\n■カスタムミラー新品\r\n\r\n■前後ウェーブディスクローター装着\r\n\r\n■他・・・新品カスタム多数\r\n\r\n\r\n■笹谷パーツ：マグザム０１誕生！\r\n\r\n■完成度が高いマグザムのフォルムを崩さないようにカスタマイズ！\r\n\r\n■さりげなく、仲間に差をつけたい貴方！\r\n\r\nハイセンスで大人っぽく決めたい貴方にお勧めです\r\n\r\n■オプションもハンドル周り・足回り・オーディオ・LED・ペイント等、ご要望に応じます\r\n\r\n■気軽にご相談ください！！\r\n\r\n●装備・価格、絶対自信があります！是非、他店と比べてください！\r\n\r\n\r\n★市場販売価格￥800,000以上を限定価格￥560,000\r\n\r\n☆一番人気で希少な黒！\r\n\r\nパーツ製造・販売元だからこの価格で販売できます\r\n\r\n★当店では整備料・登録諸費用は無料です\r\n\r\n★乗り出し価格￥560,000の他にお金は一切受け取りません。\r\n\r\n★只今、ご成約のお客様には、自賠責保険料を全額、当方が負担いたします\r\n\r\n★全国納車可能（北海道から沖縄まで配送無料キャンペーン中）\r\n\r\n■笹谷パーツ■\r\n\r\n〒351-0112\r\n\r\n埼玉県和光市丸山台2-2\r\n\r\nTEL 0120-925-338\r\n\r\n【お知らせ】\r\n現在、東北地方太平洋沖地震の影響により、計画停電が実施されておりまして、\r\nカスタム車の組み上げ作業に支障・遅れが生じております。\r\nお客様の納車を約束通りにするために昼夜、スタッフ一同作業しておりまして、\r\nなかなか電話に出れません。\r\nまた停電中は、電話回線も繋がらなく、電気が復旧しても混線で繋がらない事例もあります。\r\n大変恐れ入りますが、車両に関するお問い合わせは、当HPの「お問合せ先」より、\r\nメールでお願いいたします。\r\n電話で直接、詳細を、お聞きなりたい方は、連絡先と都合がいい時間帯を、記入していただけましたら、\r\n当方より、お電話差し上げます。\r\n \r\n笹谷パーツPC\r\nhttp://www.ssy338.com\r\n \r\n笹谷パーツモバイル\r\nhttp://my.peps.jp/sa2901\r\n \r\n※当方のカスタム車製作は、フレーム・エンジンの状態から、一つ一つのパーツを組み上げており、\r\nまた、エンジン・クランクのO/H作業も多く、二人で作業することも多いため、電話があれば、\r\n必然的に作業を中断することになり、遅れが生じます。\r\n少人数で作業してますので、何卒、わがままを、お許し願います。\r\nまた、電話でカスタム依頼を受けた場合、双方の聞き違い等により、カスタム車が完成しても、\r\nお客様のご要望通りになっていない場合があります。\r\nメールでしたら、常にお客様からのオーダーを確認できますので、間違いが無い作業ができます。\r\nよろしく、ご協力願います。\r\n営業時間AM11:00〜PM20;00', 0, 0, 0, NULL, '', 0, 0, '00', 0, '20080323070813_15437_40_1.jpg', NULL, '20080323070813_15437_40_2.jpg', NULL, '20080323070813_15437_40_3.jpg', NULL, '2008032307081