(2927, 15437, 2, 810, '', '', 2, 1, 530000, 1.0, 10000, 5300, NULL, 6497, 0, '', 250, NULL, '黒', '■フロントエアロマスク装着\r\n■盗難防止アラームイモビライザー装着\r\n■アルミナローバー装着\r\n■タンデムバックレスト装着\r\n■アルミメッキグリップ装着\r\n■ステップボード装着\r\n■デイトナ製ローダウンショック装着\r\n■ショートサイドスタンド装着\r\n■ウィルズウィン製マフラー装着\r\n■ユーロテール装着\r\n■ドリンクホルダー装着\r\n■高年式の黒エンジン・黒リアアーム・黒ホイール車です\r\n■是非、現物を見ていただき、エンジン音を聞いてください\r\nアイドリング時、アクセル吹かしてもストレス無く絶好調です\r\n■購入後、自分色にカスタムしたい方にお勧めします\r\nもちろん、通勤や、仕事に使用しても、問題ありません\r\n■全国発送無料\r\n■整備・点検無料\r\n\r\n■笹谷パーツ■\r\n\r\n〒351-0112\r\n\r\n埼玉県和光市丸山台2-2\r\n\r\nTEL 0120-925-338\r\n【お知らせ】\r\n現在、東北地方太平洋沖地震の影響により、計画停電が実施されておりまして、\r\nカスタム車の組み上げ作業に支障・遅れが生じております。\r\nお客様の納車を約束通りにするために昼夜、スタッフ一同作業しておりまして、\r\nなかなか電話に出れません。\r\nまた停電中は、電話回線も繋がらなく、電気が復旧しても混線で繋がらない事例もあります。\r\n大変恐れ入りますが、車両に関するお問い合わせは、当HPの「お問合せ先」より、\r\nメールでお願いいたします。\r\n電話で直接、詳細を、お聞きなりたい方は、連絡先と都合がいい時間帯を、記入していただけましたら、\r\n当方より、お電話差し上げます。\r\n \r\n笹谷パーツPC\r\nhttp://www.ssy338.com\r\n \r\n笹谷パーツモバイル\r\nhttp://my.peps.jp/sa2901\r\n \r\n※当方のカスタム車製作は、フレーム・エンジンの状態から、一つ一つのパーツを組み上げており、\r\nまた、エンジン・クランクのO/H作業も多く、二人で作業することも多いため、電話があれば、\r\n必然的に作業を中断することになり、遅れが生じます。\r\n少人数で作業してますので、何卒、わがままを、お許し願います。\r\nまた、電話でカスタム依頼を受けた場合、双方の聞き違い等により、カスタム車が完成しても、\r\nお客様のご要望通りになっていない場合があります。\r\nメールでしたら、常にお客様からのオーダーを確認できますので、間違いが無い作業ができます。\r\nよろしく、ご協力願います。\r\n\r\n営業時間AM11;00〜PM20:00', 0, 0, 0, NULL, '', 0, 0, '00', 0, '20080703134242_15437_47_1.jpg', NULL, '20080703134242_15437_47_2.jpg', NULL, '20080703134242_15437_47_3.jpg', NULL, '20080703134242_15437_47_4.jpg', NULL, '20080703134242_15437_47_5.jpg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, NULL, '2011-07-19 14:53:54', 'sys_err5', '2012-06-25 21:47:07'),
