(2939, 15437, 2, 810, '', '', 2, 1, 750000, 1.0, 10000, 7500, NULL, 6100, 0, '', 250, NULL, '黒', '和歌山店ＯＰＥＮ記念モデル\r\n■フロントエアロマスク・リアウィング・・・他エアロパーツ一式all装着\r\n■インナーペイント仕上げ\r\n■デイトナ:DAYTONA : ソウルプレート装着（納車時、取付）\r\n■SPI製ELメーター装着\r\n■パイオニアcarrozzeria製iPod&amp;USB対応MDデッキ新品装着\r\n■最大出力３５０Ｗ防水スピーカー２基新品装着\r\n■カスタムアルミグリップ装着\r\n■ワイズギア製パーキンギレバー装着\r\n■カスタムマシンドブレーキ装着\r\n■カスタムマスターシリンダーカバー装着\r\n■ドリンクホルダー装着\r\n■フロントフォークカバー装着\r\n■ＬＥＤチューブ装着\r\n■百鬼製ストロボ装着\r\n■ミサイルスイッチ３基装着\r\n■ダイヤカットゴージャスシート装着\r\n■タンデムバックレスト装着\r\n■ローダウンショック装着\r\n■メッキショートサイドスタンド装着\r\n■メッキサイドスタンド装着\r\n■かち上げマフラー『雷神』装着\r\n■クリアフロントウィンカー装着\r\n■クリアユーロテール装着\r\n■メッキアウターカバー装着\r\n■ＭＣエアダクト装着\r\n■カスタムエアクリーナー装着\r\n■カスタムミラー装着\r\n■前後ウェーブディスクローター装着\r\n■他・・・カスタム多数\r\n■走行距離 ： 6,100Km\r\n■年式 ： 平成14年\r\n■メインフレーム修復歴 ： なし\r\n■メインジェット交換・調整済み・キャブＯＨ済み\r\n★整備・点検後、発送いたします\r\n★全国納車可能（北海道から沖縄まで配送無料キャンペーン中）\r\n\r\n■笹谷パーツ■\r\n\r\n〒351-0112\r\n\r\n埼玉県和光市丸山台2-2\r\n\r\nTEL 0120-925-338\r\n【お知らせ】\r\n現在、東北地方太平洋沖地震の影響により、計画停電が実施されておりまして、\r\nカスタム車の組み上げ作業に支障・遅れが生じております。\r\nお客様の納車を約束通りにするために昼夜、スタッフ一同作業しておりまして、\r\nなかなか電話に出れません。\r\nまた停電中は、電話回線も繋がらなく、電気が復旧しても混線で繋がらない事例もあります。\r\n大変恐れ入りますが、車両に関するお問い合わせは、当HPの「お問合せ先」より、\r\nメールでお願いいたします。\r\n電話で直接、詳細を、お聞きなりたい方は、連絡先と都合がいい時間帯を、記入していただけましたら、\r\n当方より、お電話差し上げます。\r\n \r\n笹谷パーツPC\r\nhttp://www.ssy338.com\r\n \r\n笹谷パーツモバイル\r\nhttp://my.peps.jp/sa2901\r\n \r\n※当方のカスタム車製作は、フレーム・エンジンの状態から、一つ一つのパーツを組み上げており、\r\nまた、エンジン・クランクのO/H作業も多く、二人で作業することも多いため、電話があれば、\r\n必然的に作業を中断することになり、遅れが生じます。\r\n少人数で作業してますので、何卒、わがままを、お許し願います。\r\nまた、電話でカスタム依頼を受けた場合、双方の聞き違い等により、カスタム車が完成しても、\r\nお客様のご要望通りになっていない場合があります。\r\nメールでしたら、常にお客様からのオーダーを確認できますので、間違いが無い作業ができます。\r\nよろしく、ご協力願います。\r\n\r\n営業時間AM11;00〜PM20:00', 0, 0, 0, NULL, '', 0, 0, '00', 0, '20080727083026_15437_49_1.jpg', NULL, '20080727083026_15437_49_2.jpg', NULL, '20080727083026_15437_49_3.jpg', NULL, '20080727083026_15437_49_4.jpg', NULL, '20080727083026_15437_49_5.jpg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, NULL, '2011-07-19 14:53:54', 'sys_err5', '2012-06-25 21:47:07'),
