(2941, 1219, 1, 30, '', '', 2, 1, 63000, 1.0, 10000, 630, NULL, 15084, 0, '', 49, NULL, 'ﾎﾜｲﾄ:boxﾅｼ', '地震で倒れたりしないので^^ 暇な時に治し、ﾌﾟﾗｲﾍﾞｰﾄな使用を...と思ってました\r\n\r\nへたったCDIを(初期型ﾘｰﾄﾞ80S用へ)&amp;詰り気味のﾏﾌﾗｰを(ﾒｰｶｰ絶版で以降の新品へ少々加工)交換した後…\r\n　ｵｰﾅｰは直ぐに 結局は最速50キロ位のｽﾋﾟｰﾄﾞに不満で 単に飽きちゃってで...\r\n　　暫く放置...でした。\r\n「どうせ乗らないなら 譲って！」と入手。\r\n　ですから...まぁ 其れなりですが\r\n　　欲しい方が居れば、お譲りします\r\n\r\nﾅﾝﾄ前後共に 9分山のﾀｲﾔが付いてます\r\n　三輪ﾐﾆｶｰ登録が流行の昨今の相場よりは\r\nかなり安〜く、いじる目的ﾍﾞｰｽ車両としては\r\n　　≪まっちん^^ ｸﾞ〜≫じゃないかなぁ\r\n\r\nｴﾝｼﾞﾝ始動だけは...(と、他 少し) 加修しました所\r\n　☆やはり ｴﾝｼﾞﾝは快調でした\r\nが、要修理 Rﾌﾞﾚｰｷｹｰﾌﾞﾙ＆燃料系箇所は...です\r\n\r\n※某有名ﾋﾟｻﾞ屋さんが、2個1目的で購入\r\n　ｺﾁﾗを活かした選択との事で、そりゃそうですね\r\n　　正解です!!\r\n　　\r\n', 0, 0, 0, NULL, '', 0, 0, '00', 0, '20081007133512_1219_13_1.jpg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, NULL, '2011-07-19 14:53:54', 'sys_err5', '2012-06-25 21:47:07'),
