(2950, 858, 1, 927, '', '', 3, 1, 0, 1.0, 10000, 0, 2006, 0, 0, '', 115, '02', '赤・白', '皆さんの欲しい形を、低価格で実現しておきました。<br>とりあえず純正ベースでこの辺からはじめてはいかがでしょうか？<br><br><br>◆マフラー：ヨシムラトライオーバル<br>◆キャブ：KEIHIN PD22加速ポンプ付<br>◆エアクリーナダクト：CRF100純正<br>◆ステップ：CRF100純正　可倒式<br>◆メータ：TAKEGAWA ＬＣＤ　（ノーマルメータ250km指示で交換・メータ有）　<br>◆フロントスプリング：SHIFT UP製<br>◆リアサスペンション：TAKEGAWA <br><br>◇DAYTONA 115cc　ボアアップキット<br>◇DAYTONA ハイカムキット<br>◇DAYTONA CDI<br>◇DAYTONA ターボフィルター<br><br>ときどき、スゴウのモタードパーティやモタごっこを走らせています。<br>試乗して欲しくなった人、こんなのが欲しい人は問合せください。', 0, 0, 0, NULL, '', 0, 0, '00', NULL, '20100504114937_858_22_1.jpg', '', '20100504114937_858_22_2.jpg', '', '20100504114937_858_22_3.jpg', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 0, NULL, '2011-07-19 14:53:54', 'sys_err_2', '2012-06-25 21:47:07'),
(2957, 1219, 1, 238, '', '', 2, 1, 380000, 1.0, 10000, 3800, 1969, 1100, 0, '', 444, NULL, 'ﾌﾞﾗｯｸ・Cﾒｯｷ', '新品を多数使用にて、当然ながら綺麗で\r\n　白ﾊﾞｲのｶﾞｰﾄﾞ4点を装着の稀少な車両です\r\n　↑は、☆構変済みで、抹消登録状態☆\r\n　　再登録は、まんまで中古新規OKです\r\n一度ﾚｽﾄｱ済みの現車は\r\n　再動が安易ですが...この際ですし\r\n　　更にのﾚｽﾄｱ&amp;ｴﾝｼﾞﾝOHを、お薦めします\r\n(OH可能な部品、ほぼ全て揃っております)\r\n\r\nこのﾊﾞｲｸ、書付の欠品無しで15〜20万\r\n　ｴﾝｼﾞﾝが始動可能のなら　　ﾌﾟﾗｽ10万\r\n　　高速道走行可ﾚﾍﾞﾙで更に　　ﾌﾟﾗｽ15万\r\n後は、どれだけのﾚｽﾄｱ加修費か\r\n　程度...+α価格だと思います\r\n\r\n一端、売約済みにしてましたが…\r\n　今後暫くCL72に乗らねばならぬ事情と\r\n　　見て下さる方が結構多く\r\n　　　再度、ﾍﾞｰｽ価格を付けさせて頂き\r\n現状38万円〜価格応談したいと思ってます\r\n\r\n\r\n\r\n', 0, 0, 0, NULL, '', 0, 0, '00', 0, '20100127220423_1219_16_1.jpg', NULL, '20100129120925_1219_16_2.jpg', NULL, '20100129120925_1219_16_3.jpg', NULL, '', NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, NULL, '2011-07-19 14:53:54', 'sys_err5', '2012-06-25 21:47:07'),
