(3022, 4946, 1, 1693, '', '', 1, 1, 245700, 1.0, 10000, 2457, 2008, 0, 0, '', 110, '', 'スマートブルーメタリック', 'リード110は、主に都市部での通勤ユーザーを対象に開発したスクーターで、静粛性と経済性に優れ低燃費を実現したエンジンと、使い勝手に優れた車体サイズや充実した装備を採用している。<br>　新設計エンジンは、軽量・コンパクト化を図り、電子制御燃料噴射システム（PGM-FI※1）の採用に加え、排気ガスを浄化する触媒装置（キャタライザー）をマフラーに内蔵することで、平成19年国内二輪車排出ガス規制に適合させている。燃費は、50.0km／L（60km／h定地走行テスト値）を達成しながら力強くスムーズな走りを両立させている。<br>　新設計ボディは、シート下にクラス※2最大の35L※3の収納スペースを確保しながら、足着き性に優れた低シート高（740mm）とするなど、取り回しに優れたものとしている。また、低重心に寄与するフロアの下に配置した6.5L容量の燃料タンクによって、安定した走行フィーリングを実現している。<br>　デザインは、四輪車のスポーツセダンのイメージを取り入れながら、スクーターの機動性やスポーティさを表現している。<br>　車体色は、合計5色の豊富なバリエーションによって、ユーザーの好みに応えられるものとしている。 ※1  PGM-FI（Programmed Fuel Injection）は、Hondaの登録商標です <br>※2 第2種原動機付自転車クラス（51cc〜125cc） <br>※3 Honda調べ <br>●メーカー希望小売価格 273,000円（消費税抜き本体価格　260,000円） <br> ※価格（リサイクル費用を含む）には保険料・税金（消費税を除く）・登録などに伴う諸費用は含まれておりません。 <br>＝リードの主な特長＝<br><br>●環境性能に優れた新開発エンジン  新開発の軽量・コンパクト設計の水冷・4ストローク・OHC単気筒110ccエンジンは、高い環境性能と市街地での力強くスムーズな走りを両立させるために、電子制御燃料噴射システム（PGM-FI）を採用。このシステムは、様々な走行条件に対しコンピューター制御で最適な燃料を供給するもので、燃費は50.0km／L（60km／h定地走行テスト値）を達成している。また、寒冷時の始動を容易にしている。PGM-FIと、キャタライザーの採用などによって、平成19年国内二輪車排出ガス規制に適合させている。 <br><br>●使い勝手に優れた充実した装備  主な用途の通勤での使い勝手を徹底的に追求し、シート下にはクラス最大容量35Lの収納スペースを確保。B4サイズのバッグなどを収納できる便利な装備としている。ブレーキは、安定した制動力を得られる前・後輪連動ブレーキを採用。アルミ製の大型リアキャリアは、シートの座面と高さを合わせた形状とすることで、大きな荷物の積載時の利便性に優れたものとしている。<br>長さ650mmのロングシートは、足着き性に優れた低シート高を実現するとともに、二人乗りでもゆったりとしたポジションを可能としている。 <br><br>●高級感とスポーティさを兼ね備えたデザイン  スタイリングは、都市部でアクティブに行動するスクーターにふさわしいものとするため、四輪車のスポーツセダンのイメージを取り入れながら、質感が高くスポーティなイメージとしている。フロントからリアまでシャープな曲面で構成されたボディは、所有感を満たすとともに、市街地で映えるものとしている。 <br>', 0, 0, 0, NULL, '', 2, 0, '00', 0, '20090523180001_4946_43_1.jpg', '', '20090523180001_4946_43_2.jpg', '', '20090523180001_4946_43_3.jpg', '', '20090523180001_4946_43_4.jpg', '', '20090523180001_4946_43_5.jpg', '', '', '', '', '', '', '', '', '', '', '', 0, NULL, '2011-07-19 14:53:54', 'sys_err4', '2012-06-25 21:47:07'),
