(3025, 4946, 1, 17, '', '', 1, 1, 136600, 1.0, 10000, 1366, 2009, 0, 0, '', 50, '', 'パールプロキオンブラック', '今回の「ディオ」の車体色は、新たに、光沢が美しいデジタルシルバーメタリックと、上質感漂うペルセウスブラウンメタリックの2色を加え、継続カラーと合わせ合計5色の豊富なバリエーションとしている。<br>　エンジンは、粘り強く滑らかな出力特性の空冷・4ストロークエンジンに、優れた始動性に寄与する電子制御燃料噴射装置（PGM-FI※1）を採用。スムーズな走りを実現するとともに、73km／L（30km／h定地走行テスト値）の優れた燃費を達成している。<br>　ディオは、扱いやすい車体サイズやヘルメット収納スペースなどの使い勝手に優れた50ccのスタンダードスクーターとして、10代から50代の幅広い層に支持されている。<br>※1 PGM-FI（Programmed Fuel Injection）は、Hondaの登録商標です<br>※2 Honda調べ<br><br>＝ディオの従来からの特長＝<br><br>●環境性能に優れたエンジン  空冷・4ストローク・単気筒50ccエンジンは、環境性能とスムーズな走りを両立させる、電子制御燃料噴射装置（PGM-FI）を採用。このシステムは、様々な走行条件に対し、コンピューター制御で最適な燃料を供給するもので、燃費は73km／L（30km／h定地走行テスト値）を達成している。また、寒冷時における始動を容易にし、スムーズな発進加速も実現。PGM-FIと、マフラー内に触媒装置（キャタライザー）を採用することで、国内二輪車排出ガス規制に適合させている。 <br><br>●充実の各種装備  ・ 制動時の安心感を高める「コンビブレーキ（前・後輪連動ブレーキ）」 <br>・ 大容量22L※3のシート下メットインスペース <br>・ 小物の収納に便利なフロントインナーボックス <br>・ 盗難抑止に効果的なシャッター付きのキーシリンダー <br>・ 盗難抑止に効果的なUロック（（株）ホンダアクセス製 別売）を収納できるリアキャリア <br>※3 Honda調べ <br><br>＝カラーバリエーション＝<br>「ディオ」 ・デジタルシルバーメタリック（新色）  ・ペルセウスブラウンメタリック（新色） <br>・パールコットンアイボリー（継続） ・パールプロキオンブラック（継続） <br>・キャンディールーシッドレッド（継続）  <br>', 0, 0, 0, NULL, '', 2, 0, '00', 0, '20081030152243_4946_47_1.jpg', '', '20081030152243_4946_47_2.jpg', '', '20081030152243_4946_47_3.jpg', '', '20081030152243_4946_47_4.jpg', '', '', '', '', '', '', '', '', '', '', '', '', '', 0, NULL, '2011-07-19 14:53:54', 'sys_err4', '2012-06-25 21:47:07'),
