(3027, 4946, 1, 17, '', '', 1, 1, 136600, 1.0, 10000, 1366, 2008, 0, 0, '', 50, '', 'パールコットンアイボリー', '今回の「ディオ」は、新たにブラックとブラウンのツートーンのシートを採用。また、新デザインの「Dio」のロゴをサイドカバーにあしらうことで、質感の高いスタイリッシュな外観としている。<br>　車体色は、5色の豊富なバリエーションで、幅広い層のニーズに対応している。<br>　エンジンは、優れた始動性に寄与する電子制御燃料噴射システム（PGM-FI）を新たに搭載することで、スムーズな走りを実現している。<br>燃費は、73km／L（30km／h定地走行テスト値）を達成し、従来モデルに比べ約12％の向上を図りCO2の低減を実現している。また、排気ガスを浄化する触媒装置（キャタライザー）をマフラー内に装備することで、平成18年国内二輪車排出ガス規制に適合させている。<br><br>　ディオは、粘り強く滑らかな出力特性の空冷4ストロークエンジンと、扱いやすい車体サイズやヘルメット収納スペースなどの使い勝手に優れた50ccのスタンダードスクーターとして、10代から50代の幅広い層に支持されている。<br>※1 PGM-FI（Programmed Fuel Injection）は、Hondaの登録商標です<br><br>＝ディオの主な特徴＝<br><br>●環境性能を高めたスムーズなエンジン  空冷・4ストローク・単気筒50ccエンジンは、環境性能とスムーズな走りを両立させるために、電子制御燃料噴射システム（PGM-FI）を新たに採用。このシステムは、様々な走行条件に対し、コンピューター制御で最適な燃料を供給するもので、燃費は従来モデルに比べ約12％の向上を図った73km／L（30km／h定地走行テスト値）を達成している。また、寒冷時における始動を容易にし、スムーズな発進加速も実現している。さらに、バッテリーが完全に放電した場合でも、キックによって始動ができる先進のシステムを採用している。<br>PGM-FIと、マフラー内にキャタライザーを採用することで、平成18年国内二輪車排出ガス規制に適合させている。 <br><br>●充実の各種装備  ・制動時の安心感を高める「コンビ・ブレーキ（前・後輪連動ブレーキ）」 <br>・大容量22Lのシート下メットインスペース※2 <br>・小物の収納に便利なフロントインナーボックス <br>・盗難抑止に効果的なシャッター付きのキーシリンダー <br>・盗難抑止に効果的なUロック（（株）ホンダアクセス製 別売）を収納できるリアキャリア <br> <br>※2、3はHonda調べ <br> <br>', 0, 0, 0, NULL, '', 2, 0, '00', 0, '20081030161930_4946_48_1.jpg', '', '20081030161930_4946_48_2.jpg', '', '20081030161930_4946_48_3.jpg', '', '20081030161930_4946_48_4.jpg', '', '20081030161930_4946_48_5.jpg', '', '', '', '', '', '', '', '', '', '', '', 0, NULL, '2011-07-19 14:53:54', 'sys_err4', '2012-06-25 21:47:07'),
(3028, 4946, 1, 70, '', '', 1, 1, 118600, 1.0, 10000, 1186, 2008, 0, 0, '', 50, '', 'ペルセウスブラウンメタリック', '環境に配慮した電子制御燃料噴射装置（PGM-FI※）の採用や、機能性に優れ好評を得ている原付スクーター「トゥデイ」<br>毎日の生活の身近な乗り物として2002年8月に誕生して以来、コンパクトな車体サイズでありながら、便利なシート下収納スペースや、前・後輪連動ブレーキなどの充実した装備を採用している。使い勝手に優れたモデルとして、10代をはじめ60代など、幅広い層のお客様から好評を得ており、エントリーモデルとしても人気の高い原付スクーターである。<br>※PGM-FI（Programmed Fuel Injection）は、Hondaの登録商標です。<br>', 0, 0, 0, NULL, '', 2, 0, '00', 0, '20081030172802_4946_50_1.jpg', '', '20081030172802_4946_50_2.jpg', '', '20081030172802_4946_50_3.jpg', '', '20081030172802_4946_50_4.jpg', '', '20081030172802_4946_50_5.jpg', '', '', '', '', '', '', '', '', '', '', '', 0, NULL, '2011-07-19 14:53:54', 'sys_err4', '2012-06-25 21:47:07'),
(3029, 4946, 1, 105, '', '', 1, 1, 178500, 1.0, 10000, 1785, 2007, 0, 0, '', 100, '', 'パールコーンイエロー', '通勤・通学などの市街地走行に適した扱いやすいサイズの車体に、静粛性と低燃費に優れたコンパクトな空冷・4ストローク・100ccエンジンを搭載したスクーター「スペイシー100」<br>フロントブレーキのキャリパーやリアキャリアをブラック塗装とし、ロゴマークを一新することで、精悍なイメージとするとともに、シートにステッチ加工を施すことによって、より高級感を演出している。<br><br>　「スペイシー100」は、中国の五羊−本田摩托（広州）有限公司が生産を担当し、国内に輸入され、2003年9月に発売。このモデルは、発進、加速の繰り返しが多い街中での扱い易さに配慮した低・中回転域重視の空冷・4ストロークエンジンを搭載。また、コンビ・ブレーキシステム（前・後輪連動ブレーキ）を装備するとともに、フルフェイスヘルメット（1個）※などの収納が可能な22Lのシート下収納スペースを設けるなど、充実の装備を施したモデルとして中高年層に好評を得ているモデルである。<br>※　一部特殊な形状のヘルメットは、入らない場合があります。<br>最終型在庫限り', 0, 0, 0, NULL, '', 2, 0, '00', 0, '20081030173724_4946_51_1.jpg', '', '20081030173724_4946_51_2.jpg', '', '20081030173724_4946_51_3.jpg', '', '20081030173724_4946_51_4.jpg', '', '20081030173724_4946_51_5.jpg', '', '', '', '', '', '', '', '', '', '', '', 0, NULL, '2011-07-19 14:53:54', 'sys_err4', '2012-06-25 21:47:07'),
