(3035, 4946, 1, 105, '', '', 1, 1, 178500, 1.0, 10000, 1785, 2007, 0, 0, '', 100, '', 'コスミックシルバーメタリック', '通勤・通学などの市街地走行に適した扱いやすいサイズの車体に、静粛性と低燃費に優れたコンパクトな空冷・4ストローク・100ccエンジンを搭載したスクーター「スペイシー100」<br>フロントブレーキのキャリパーやリアキャリアをブラック塗装とし、ロゴマークを一新することで、精悍なイメージとするとともに、シートにステッチ加工を施すことによって、より高級感を演出している。<br><br>　「スペイシー100」は、中国の五羊−本田摩托（広州）有限公司が生産を担当し、国内に輸入され、2003年9月に発売。このモデルは、発進、加速の繰り返しが多い街中での扱い易さに配慮した低・中回転域重視の空冷・4ストロークエンジンを搭載。また、コンビ・ブレーキシステム（前・後輪連動ブレーキ）を装備するとともに、フルフェイスヘルメット（1個）※などの収納が可能な22Lのシート下収納スペースを設けるなど、充実の装備を施したモデルとして中高年層に好評を得ているモデルである。<br>※　一部特殊な形状のヘルメットは、入らない場合があります。<br>最終型在庫限り', 0, 0, 0, NULL, '', 2, 0, '00', 0, '20081104114502_4946_52_1.jpg', '', '20081104114502_4946_52_2.jpg', '', '20081104114502_4946_52_3.jpg', '', '20081104114502_4946_52_4.jpg', '', '20081104114502_4946_52_5.jpg', '', '', '', '', '', '', '', '', '', '', '', 0, NULL, '2011-07-19 14:53:54', 'sys_err4', '2012-06-25 21:47:07'),
