(3082, 2019, 1, 14, '', '', 1, 3, 182700, 1.0, 10000, 1827, 2011, 0, 0, '', 50, '', '各色', 'モトサーチ特別価格！<br><br>定価204,750(消費税抜本体価格 195,000)<br><br>力強さ、経済性、静粛性、信頼性を高い次元で実現するHonda伝統の4ストロークOHCエンジンに、乗る人にも地球にもうれしい性能をプラスしました。PGM-FIは、走っている状況に応じてコンピューターが判断し、理想的な燃料噴射量とタイミングを調整する電子制御の燃料噴射装置。ムダなく効率的に燃料を使うので、環境性能に優れ、経済的で低燃費。また、寒い朝など季節や天気に関わりなく、その日の状況に応じてスムーズにらくらくエンジンが始動。コンピューター制御にも関わらず、バッテリーがあがったときでもキックで簡単に始動できます。そして、つねに理想的な状態で燃焼することでパワフルな走りも実現して、坂道発進や加速の時などにもタフな力強さを発揮。さらに、エキゾーストパイプ内にターンフロー構造の排気ガス浄化装置（キャタライザー）を搭載して、効率的な燃焼で余分な排出ガスを抑えるPGM-FIとともに、環境性能をさらに高めています。クリーンな性能と寒さにも強いバツグンの始動性、従来どおりの軽快でパワフルな走りと低燃費。毎日の仕事にさらに快適な、先進のエンジンです。<br><br>PGM-FI（Programmed Fuel Injection System）<br>電子制御による燃料噴射装置。大気の状態やエンジン回転数などから、コンピューターが常に理想的な燃料の使い方をコントロール。燃料を最適な量とタイミングで供給するので、エンジンのパフォーマンスを効率よく引き出します。<br>', 0, 0, 0, 9999999, '', 0, 0, '00', 0, '20081130225750_2019_92_1.jpg', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 0, NULL, '2011-07-19 14:53:54', 'cciida', '2012-10-04 07:04:01'),
(3083, 15437, 2, 811, '', '', 1, 1, 610000, 1.0, 10000, 6100, NULL, NULL, 0, '', 250, NULL, '白', '■フロントエアロマスク・リアスポイラー装着\r\n■インナーペイント済\r\n■エナメルスポーツシート装着\r\n■ステップボード装着\r\n■ローダウンショック装着\r\n■カスタム左右ダブルエアクリーナー装着\r\n■カスタムかち上げマフラー新品\r\n■クランクケースカバー装着\r\n■フロントフォークカバー装着\r\n■アルミグリップ装着\r\n■マシンドブレーキレバー装着\r\n■カスタムハンドルポスト装着\r\n■カスタムミラー装着\r\n■フェンダーレスキット装着\r\n■タイヤ前後新品交換済\r\n■価格には整備・点検料も含みます\r\n■乗り出し価格です\r\n■ローン可能\r\n■全国発送可能\r\n\r\n■笹谷パーツ■\r\n\r\n〒351-0112\r\n\r\n埼玉県和光市丸山台2-2\r\n\r\nTEL 0120-925-338\r\n【お知らせ】\r\n現在、東北地方太平洋沖地震の影響により、計画停電が実施されておりまして、\r\nカスタム車の組み上げ作業に支障・遅れが生じております。\r\nお客様の納車を約束通りにするために昼夜、スタッフ一同作業しておりまして、\r\nなかなか電話に出れません。\r\nまた停電中は、電話回線も繋がらなく、電気が復旧しても混線で繋がらない事例もあります。\r\n大変恐れ入りますが、車両に関するお問い合わせは、当HPの「お問合せ先」より、\r\nメールでお願いいたします。\r\n電話で直接、詳細を、お聞きなりたい方は、連絡先と都合がいい時間帯を、記入していただけましたら、\r\n当方より、お電話差し上げます。\r\n \r\n笹谷パーツPC\r\nhttp://www.ssy338.com\r\n \r\n笹谷パーツモバイル\r\nhttp://my.peps.jp/sa2901\r\n \r\n※当方のカスタム車製作は、フレーム・エンジンの状態から、一つ一つのパーツを組み上げており、\r\nまた、エンジン・クランクのO/H作業も多く、二人で作業することも多いため、電話があれば、\r\n必然的に作業を中断することになり、遅れが生じます。\r\n少人数で作業してますので、何卒、わがままを、お許し願います。\r\nまた、電話でカスタム依頼を受けた場合、双方の聞き違い等により、カスタム車が完成しても、\r\nお客様のご要望通りになっていない場合があります。\r\nメールでしたら、常にお客様からのオーダーを確認できますので、間違いが無い作業ができます。\r\nよろしく、ご協力願います。\r\n\r\n営業時間AM11;00〜PM20:00', 0, 0, 0, NULL, '', 0, 0, '00', 0, '20081202105152_15437_65_1.jpg', NULL, '20081202105152_15437_65_2.jpg', NULL, '20081202105152_15437_65_3.jpg', NULL, '20081202105152_15437_65_4.jpg', NULL, '20081202105152_15437_65_5.jpg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, NULL, '2011-07-19 14:53:54', 'sys_err5', '2012-06-25 21:47:07'),
