(3098, 15437, 1, 174, '', '', 2, 1, 390000, 1.0, 10000, 3900, 2001, 13570, 0, '', 250, NULL, '黒', '■外装カウル全塗装済み\r\n■フロントエアロマスク装着\r\n■エナメルダイヤカット新品\r\n■タンデムバックレスト装着\r\n■ステップボード新品\r\n■ローダウンショック新品\r\n■ショートサイドスタンド新品\r\n■カスタムエアクリーナー新品\r\n■カチ上げマフラー新品\r\n■メッキプーリーケースカバー新品\r\n■メッキフロントウィンカー新品\r\n■クリアユーロテール新品\r\n■カスタムグリップ新品\r\n■アルミナローバー新品\r\n■フェンダーレスキット新品\r\n\r\n■笹谷パーツ■\r\n\r\n〒351-0112\r\n\r\n埼玉県和光市丸山台2-2\r\n\r\nTEL 0120-925-338\r\n\r\n【お知らせ】\r\n現在、東北地方太平洋沖地震の影響により、計画停電が実施されておりまして、\r\nカスタム車の組み上げ作業に支障・遅れが生じております。\r\nお客様の納車を約束通りにするために昼夜、スタッフ一同作業しておりまして、\r\nなかなか電話に出れません。\r\nまた停電中は、電話回線も繋がらなく、電気が復旧しても混線で繋がらない事例もあります。\r\n大変恐れ入りますが、車両に関するお問い合わせは、当HPの「お問合せ先」より、\r\nメールでお願いいたします。\r\n電話で直接、詳細を、お聞きなりたい方は、連絡先と都合がいい時間帯を、記入していただけましたら、\r\n当方より、お電話差し上げます。\r\n \r\n笹谷パーツPC\r\nhttp://www.ssy338.com\r\n \r\n笹谷パーツモバイル\r\nhttp://my.peps.jp/sa2901\r\n \r\n※当方のカスタム車製作は、フレーム・エンジンの状態から、一つ一つのパーツを組み上げており、\r\nまた、エンジン・クランクのO/H作業も多く、二人で作業することも多いため、電話があれば、\r\n必然的に作業を中断することになり、遅れが生じます。\r\n少人数で作業してますので、何卒、わがままを、お許し願います。\r\nまた、電話でカスタム依頼を受けた場合、双方の聞き違い等により、カスタム車が完成しても、\r\nお客様のご要望通りになっていない場合があります。\r\nメールでしたら、常にお客様からのオーダーを確認できますので、間違いが無い作業ができます。\r\nよろしく、ご協力願います。\r\n\r\n営業時間AM11;00〜PM20:00', 0, 0, 0, NULL, '', 0, 0, '00', 0, '20081208040922_15437_66_1.jpg', NULL, '20081208040922_15437_66_2.jpg', NULL, '20081208040922_15437_66_3.jpg', NULL, '20081208040922_15437_66_4.jpg', NULL, '20081208040922_15437_66_5.jpg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, NULL, '2011-07-19 14:53:54', 'sys_err5', '2012-06-25 21:47:07'),
