(3106, 2019, 2, 950, '', '', 1, 3, 447300, 1.0, 10000, 4473, 2010, 0, 0, '', 250, NULL, 'ホワイト', 'モトサーチ価格！\r\n\r\n定価￥514,500税込\r\n(本体価格￥490,000)\r\n\r\n軽量コンパクト、軽二輪フルスケールの249cm3・空冷エンジンを搭載。放熱性に優れたアルミメッキシリンダーや、メカノイズ低減に貢献する鍛造ピストンに加え、新たにFI(フューエルインジェクション)を採用。全回転域での力強いトルクと、軽快な吹けあがりを実現している。また始動性とアイドリングの安定性を向上するとともに、環境性能にも配慮。街中のさまざまなシチュエーションで、軽快かつ力強いXT250Xならではの爽快な走りを実現している。\r\n\r\nシートは充分なクッション厚と程よい硬さで、疲労の少ない乗り心地を実現。790mmの低シート高と角を丸めたスリムなデザインにより、優れた足着き性を達成している。\r\n\r\nハンドル切れ角は、ワイドな51度。1,365mmのショートホイールベースとあいまって、最小回転半径1.9mを達成し、優れた取り回しを実現している。\r\n\r\nフロント、リアともに17インチ・アルミ製ディープバイオレットアルマイトリムを採用。足まわりの軽量化はもとより、軽快な運動性能にも寄与。デザイン面でも足元のディープバイオレットカラーが、スタイリッシュな印象をより強調している。', 0, 0, 0, 9999999, '', 0, 0, '00', 0, '20100312100533_2019_113_1.jpg', NULL, '20100312100533_2019_113_2.jpg', NULL, '20100312100533_2019_113_3.jpg', NULL, '20100312100533_2019_113_4.jpg', NULL, '20100312100533_2019_113_5.jpg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, NULL, '2011-07-19 14:53:54', 'cciida', '2012-10-04 07:07:06'),
(3107, 2019, 2, 1566, '', '', 1, 1, 637350, 1.0, 10000, 6373, 2010, 0, 0, '', 250, NULL, 'ブルー、ブラック', 'モトサーチ特別価格！\r\n\r\n定価￥732,900税込\r\n(本体価格￥698,000)\r\n\r\nアクセルワークに即応するリニアなレスポンスと、シャープな吹け上がり。それは、心地よいエキゾーストノートとあいまって、ライダーに刺激的な時間を提供する。エンジンは77.0mm×53.6mmのビッグボア・ショートストローク設計で、大径のチタン製吸気バルブ、さらにフューエルインジェクションなどを採用。低中速域での豊かなトルク特性に加え、10,000r/minで最高出力を発揮。これまでの4ストロークオン・オフマシンでは成しえなかった、圧倒的な高回転を実現した。また、始動はセルモーターのみ。軽量化を図るとともに、トルクリミッターとオートデコンプを装備し、優れた始動性を実現している。\r\n\r\nリニアかつシャープなレスポンスを達成するため、効率的に空気を採り入れるダウンドラフト・ストレート吸気方式を採用。フレーム形状、リアサスペンションの理想的なレイアウトを徹底追求することで実現したこの方式が、卓越したパフォーマンスを生み出している。また吸気制御バルブを設けるとともに、排気特性の改善を図る排気デバイスEXUPと相互に最適化。吸気から排気まで、空気の流れの総合的なコントロールを可能にした。\r\n\r\nあらゆるシーンで、思いのままのパフォーマンスを。そのため、エンジンの細部にわたり、クオリティと信頼性を磨き上げた。耐熱強度に優れ、高強度かつ軽量な鍛造ピストンや、優れた放熱性を発揮するメッキシリンダーを採用。さらに「3軸配置・左カムチェーン」は、YZ系4ストローク・コンペティションモデルに匹敵するコンパクトな設計。加えて、滑らかで扱いやすい操作荷重のクラッチ、さまざまな走行条件に対応する6速ミッションを装備した。\r\n\r\n精悍なイメージのブラック塗装・3分割セミダブルクレードルフレーム(メインフレーム:アルミ鋳物/アルミ鍛造、ダウンチューブ・リアフレーム:鋼管製)。メインフレームは、前後2つの鋳造アルミパーツと鍛造アルミパーツを高精度で溶接。またダウンチューブ部は、高強度鋼管を肉薄設計したパイプ材を採用。ストレート吸気方式を最大限に活かすフレームワークに加え、マスの集中化を達成し、軽量化と剛性バランスを両立。軽快なハンドリングに貢献している。\r\n\r\n軽量化と、優れたサスペンションの追従性実現のために。リアアームは、異形断面形状とすることで軽量かつ良好な剛性・強度バランスを確保。ブラック塗装で、躍動的な外観も演出している。またエンド部はクサビ型タイプとし、22mmのリアアクスルシャフト径とあいまって、優れた剛性と軽量化を達成した。\r\n\r\nオンロードでの優れた走行安定性、ニュートラルなステアリング特性を実現するため、サスペンションも徹底して造り込んだ。フロントフォークには、大径46mmのインナーチューブと270mmのストロークを持つ倒立式を採用。アンダーブラケット、ハンドルクラウン、ステアリング軸にも最適なアルミ素材を選択し、良好な剛性バランスと軽量化を達成している。またリンク式リアサスペンションは、ロッド径14mm・シリンダー径46mmの大径タイプ。軽量アルミ製リアアームとのマッチングにより、優れた路面追従性を実現。またフロント・リアともに、伸び側・圧側双方の減衰力調整機構を持つフルアジャストタイプを採用。走行条件やライダーの好みに応じたきめ細かな調整が可能となっている。\r\n\r\nボディは、マシン中心部のギュッとした塊感と、対照的に薄く軽快なイメージのフロント&amp;リアセクションで構成。デザインコンセプトは、「徹底的なマスの集中化と、ミニマムな軽快感の対比」である。マフラーは、極力マシンの重心へ。フロント&amp;リアフェンダー、サイドカバーもミニマムなデザインとし、ライセンスプレートホルダーは機能的かつ軽量化を重視したアルミステータイプ。足回りは、圧倒的な存在感を主張する前後17インチホイール&amp;大径ウェーブディスクブレーキ。また、軽量・省電力設計の15灯LED採用のテールライトに加え、シュラウドはラジエターの放熱性と乗車時のホールド感を両立したデザイン。コンパクト感を強調すると同時に、自在なライディングポジションにも貢献している。なお、コンペティションモデル「YZ」のイメージを継承したボディカラー&amp;新デザインのグラフィックを採用。レースシーンを印象づけるディープパープリッシュブルーソリッドEとヤマハブラックの2タイプをラインナップした。\r\n\r\nハンドル、ヒップポジション、フットレスト位置が、良好なバランスを構築。コーナリング時などの積極的な体重移動に適した、アップライトで一体感あるライディングポジションを実現した。またスチール製フューエルタンク、シートはスリムな形状とし、シュラウドの形状ともあいまって優れたニーグリップ性を獲得。さらにシート表皮には、YZ系コンペティションモデル同様のフロステッドパターンを採用。優れたフィット感、グリップ性が、自在なライディングに寄与している。\r\n\r\n基本モード」「計測モード」の2モードを設定。「計測モード」ではストップウォッチ・距離補正トリップなどの機能を、「基本モード」では時計・トリップ機能に加え、フューエルインジェクションシステムの自己診断機能を装備した。', 0, 0, 0, NULL, '', 0, 0, '00', 0, '20100312100411_2019_114_1.jpg', NULL, '20100312100411_2019_114_2.jpg', NULL, '20100312100411_2019_114_3.jpg', NULL, '20100312100411_2019_114_4.jpg', NULL, '20100312100411_2019_114_5.jpg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, NULL, '2011-07-19 14:53:54', 'sys_err5', '2012-06-25 21:47:07'),
