(3120, 2019, 1, 935, '', '', 1, 3, 273000, 1.0, 10000, 2730, 2011, 0, 0, '', 50, '', 'シルバー、ブラック', 'モトサーチ特別価格！<br><br>エイプ・50 Type D <br>●優れた制動性能を発揮する、 前・後輪油圧式ディスクブレーキ。<br>●脚まわりをスポーティーに演出する、6本スポークのアルミキャストホイール。<br>●タンクとサイドカバーに施された、 斬新なグラフィック。<br>●マットグレー塗装を施した、左右クランクケースカバーとシリンダーヘッドカバー。<br><br>タフで信頼性の高い空冷4ストロークOHC 単気筒直立エンジンに、環境性能に優れ経済的で好燃費な走りを実現するPGM-FI を搭載。全回転域での理想的な燃焼コントロールにより、発進や加速の際にも力強さを発揮。また、エキゾーストパイプ内に採用した触媒装置とあわせて、環境への配慮も徹底している。 <br><br>燃料消費率　93.0 （国土交通省届出値）<br>*30km/h定地走行燃費(km/l) <br><br><br>PGM-FI（Programmed Fuel Injection System）<br>電子制御による燃料噴射装置。大気の状態やエンジン回転数などから、コンピューターが常に理想的な燃料の使い方をコントロール。燃料を最適な量とタイミングで供給するので、エンジンのパフォーマンスを効率よく引き出します<br><br><br>', 0, 0, 0, 9999999, '', 1, 0, '00', 0, '20081211205222_2019_127_1.jpg', '', '20081211205222_2019_127_2.jpg', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 0, NULL, '2011-07-19 14:53:54', 'system', '2012-01-17 15:27:59'),
