(3146, 2019, 1, 1582, '', '', 1, 1, 457380, 1.0, 10000, 4573, 2009, 0, 0, '', 230, NULL, 'イエロー、ブラック', 'モトサーチ特別価格！\r\n\r\n定価508,200(消費税抜本体価格 484,000)\r\n\r\nHondaは、軽量・コンパクトで取り回しの良い車体に、空冷・4ストローク・単気筒223ccエンジンを搭載した軽二輪スポーツモデル「XR230」と「XR230 モタード」のカラーリングを変更し、XR230は12月19日(金)に、XR230 モタードは2009年1月13日(火)に発売する。\r\n\r\nXR230の車体色は、エクストリームレッドとロスホワイトの2色を設定。それぞれ、前・後のホイールリムは軽快なイメージのシルバーカラーを採用している。エクストリームレッドは、オフロードのフラッグシップモデル「CRF450R」のカラーリングとストライプを踏襲。側面、上面ともに鮮やかなレッドのシートとホワイトのリアフェンダーによって、さらに躍動感あふれるイメージとしている。ロスホワイトは、軽快なイメージのストライプを、タンクシュラウドとリアサイドカバーに施している。また、ツートーンシートは、上面をシルバーに、側面をブラックにすることで、引き締まった精悍なイメージとしている。\r\nXR230 モタードの車体色は、プラズマイエローとブラックの2色を設定。カラーリングおよびストライプを変更し、市街地でより映えるものとしている。プラズマイエローは、イエローとブラックのツートーンシートへの変更に加え、燃料タンク、前・後フェンダー、リアサイドカバー、フロントバイザーをブラックで統一。前・後ホイールリムにはゴールドカラーを採用し、より存在感のあるイメージとしている。ブラックは、タンクシュラウドにブラックのストライプを配することで、全身をブラックで統一し、より精悍なイメージとしている。\r\nXR230は、市街地からオフロードまで幅広いシーンで、初心者からベテランまで幅広く愛用されている。XR230 モタードは、XR230をベースに前・後輪に17インチのオンロードタイヤを装着したモデルで、特に市街地での扱いやすさに優れたモデルとして好評を得ている。\r\n', 0, 0, 0, NULL, '', 0, 0, '00', 0, '20081219184243_2019_138_1.jpg', NULL, '20081219184243_2019_138_2.jpg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, NULL, '2011-07-19 14:53:54', 'cciida', '2012-10-04 06:47:35'),
