(3224, 4946, 1, 70, '', '', 1, 1, 128000, 1.0, 10000, 1280, 2008, 0, 0, '', 50, '', 'キャンディーブレイズオレンジ', '原付スクーター「トゥデイ・F スペシャル」を限定発売 <br> <br>　Hondaは、原付スクーター「トゥデイ」にFashionableの頭文字をネーミングに取り入れ、より一層おしゃれなスタイリングにした「トゥデイ・F」に特別なカラーリングを施した「トゥデイ・F スペシャル」を台数限定で発売した。<br><br>　今回、トゥデイ・F スペシャルには、一際目を引く鮮やかなカラーリングのキャンディーブレイズオレンジを採用。シートは、ブラウンとグレーのツートーンとし、より一層おしゃれなデザインに仕上げている。<br><br>　トゥデイシリーズは、環境に配慮した電子制御燃料噴射装置（PGM-FI※）を採用した50cc原付スクーターで、毎日の生活に役立つ身近な乗り物として利便性の高いコンパクトな車体と充実した装備を搭載したモデルである。また、このシリーズは豊富なカラーバリエーションを設定しており、10代から60代までの幅広い層のお客様から高い支持を得ているロングセラーモデルである。<br>※PGM-FI（Programmed Fuel Injection）は、Hondaの登録商標です<br> <br>●メーカー希望小売価格 139,650円（消費税抜き本体価格　133,000円） <br> ※価格（リサイクル費用を含む）には保険料・税金（消費税を除く）・登録などに伴う諸費用は含まれておりません。 <br><br>主要諸元 <br><br>通称名 トゥデイ <br>車名・型式 ホンダ・JBH-AF67 <br>全長×全幅×全高（m） 1.695×0.630×1.030 <br>軸距（m） 1.180 <br>最低地上高（m） 0.110 <br>シート高（m） 0.695 <br>車両重量（kg） 79 <br>乗車定員（人） 1 <br>最小回転半径（m） 1.8 <br>エンジン型式・種類 AF67E・空冷4ストロークOHC単気筒 <br>総排気量（cm3） 49 <br>内径×行程（mm） 37.8×44.0 <br>圧縮比 10.1 <br>最高出力（kW［PS］／rpm） 3.0［4.1］／8,250 <br>最大トルク（N・m［kg・m］／rpm） 3.7［0.38］／7,500 <br>燃料消費率（km／L） 73.0（30km／h定地走行テスト値） <br>燃料供給装置形式 電子式＜電子制御燃料噴射装置（PGM-FI）＞ <br>始動方式 セルフ式（キック式併設） <br>点火装置形式 フルトランジスタ式バッテリー点火 <br>潤滑方式 圧送飛沫併用式 <br>燃料タンク容量（L） 4.6 <br>クラッチ形式 乾式多板シュー式 <br>変速機形式 無段変速式（Vマチック） <br>変速比 1　速 2.850〜0.860 <br>減速比 1　次 3.600 <br>2　次 3.769 <br>キャスター（度）／トレール（mm） 26°30´／71 <br>タイヤサイズ 前 80／100-10 46J <br>後 80／100-10 46J <br>ブレーキ形式 前 機械式リーディング・トレーリング <br>後 機械式リーディング・トレーリング <br>懸架方式 前 テレスコピック式 <br>後 ユニットスイング式 <br>フレーム形式 アンダーボーン <br>製造事業者／新大州本田摩托有限公司　　製造国／中国　　輸入事業者／本田技研工業株式会社<br>※「トゥデイ」と「トゥデイ・F」の諸元内容は、同一です。<br> ', 0, 0, 0, NULL, '', 2, 0, '00', 0, '20090123112759_4946_53_1.jpg', '', '20090214100340_4946_53_2.jpg', '', '20090214100340_4946_53_3.jpg', '', '20090214100340_4946_53_4.jpg', '', '20090214100340_4946_53_5.jpg', '', '', '', '', '', '', '', '', '', '', '', 0, NULL, '2011-07-19 14:53:54', 'sys_err4', '2012-06-25 21:47:07'),
