(3459, 4946, 1, 70, '', '', 1, 1, 120960, 1.0, 10000, 1209, 2008, 0, 0, '', 50, '', 'キャンディーブレイズオレンジ', 'スタンダードタイプの「トゥデイ」は、車体色を変更し、鮮やかなオリオンイエローと、モノトーンで精悍なイメージを与えるパールキャンサーホワイトの2色を採用。Fタイプとスタンダードタイプの双方と合わせ合計10色を設定し、カラーバリエーションに富んだシリーズとしている。<br><br>　トゥデイは、毎日の生活の身近な乗り物として2002年8月に誕生して以来、コンパクトな車体サイズでありながら、便利なシート下収納スペースや、前・後輪連動ブレーキなどの充実した装備を採用している。使い勝手に優れたモデルとして、10代をはじめ60代など、幅広い層のお客様から好評を得ており、エントリーモデルとしても人気の高い原付スクーターである。<br>※PGM-FI（Programmed Fuel Injection）は、Hondaの登録商標です<br>', 0, 0, 0, NULL, '', 2, 0, '00', 0, '20090406181537_4946_59_1.jpg', '', '20090406181537_4946_59_2.jpg', '', '20090406181537_4946_59_3.jpg', '', '20090406181537_4946_59_4.jpg', '', '20090406181537_4946_59_5.jpg', '', '', '', '', '', '', '', '', '', '', '', 0, NULL, '2011-07-19 14:53:54', 'sys_err4', '2012-06-25 21:47:07'),
