(3501, 2019, 1, 43, '', '', 2, 1, 183750, 1.0, 10000, 1837, 2001, 1175, 0, '', 50, NULL, 'トリコロール', '人気の2001モデルトリコロール限定カラーです。 \r\n値下げしました。 \r\n店頭にありますので見に来てくださいね！ \r\n\r\n\r\n★Jums-B Monkey(ジャムスビー モンキー)ヘルメット 発売 \r\nカラー、 ホワイト/モンキー(左)、シルバー/モンキー(右) \r\nサイズ、 F (フリー)(57〜59cm) \r\n規格、 PSC/SG 自動二輪車用 \r\n好評販売中！ \r\n\r\n◆当店はAB27モデルの走行距離の少ない車両を中心に20台前後ラインナップしております。 \r\nいろいろなカラーが在りますので是非お立寄り下さい。 \r\nモンキーのカスタム等も行います。 ご相談下さい! \r\n\r\n※AB27モンキーゴリラ強化買取中です!宜しくお願いいたします。 \r\n\r\n◆参考乗出し価格 \r\n車両本体価格 183,750 円 \r\n登録代行手数料 5,250 円 \r\n納車整備手数料 7,350 円 \r\n自賠責保険（1年） 6,960 円 \r\nグッドライダー防犯登録 1,050 円 \r\n計 204,360 円 \r\n', 0, 0, 0, NULL, '', 0, 0, '00', 0, '20090418173812_2019_202_1.jpg', NULL, '20090418173812_2019_202_2.jpg', NULL, '20090418173812_2019_202_3.jpg', NULL, '20090418173812_2019_202_4.jpg', NULL, '20091102095720_2019_202_5.jpg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, NULL, '2011-07-19 14:53:54', 'sys_err5', '2012-06-25 21:47:07'),
