(3511, 2019, 1, 39, '', '', 2, 1, 281400, 1.0, 10000, 2814, 2004, 385, 0, '', 50, NULL, 'パールヘロンブル-', '綺麗なブルーのマグナフィフティーが入荷しました。 \r\n\r\nマグナフィフティーも排ガス規制の為2007年式を最後に絶版車となってしまいました。 \r\n\r\nとても残念です(;_;) \r\n\r\n今後の生産予定は無いそうです。 \r\n\r\n\r\n◆参考乗出し価格 \r\n車両本体価格 281,400 円 \r\n登録代行手数料 5,250 円 \r\n納車整備手数料 7,350 円 \r\n自賠責保険(1年) 6,960 円 \r\nグッドライダー防犯登録 1,050 円 \r\n支払合計 302,010 円 \r\n', 0, 0, 0, NULL, '', 0, 0, '00', 0, '20090424223851_2019_210_1.jpg', NULL, '20090424223851_2019_210_2.jpg', NULL, '20090424223851_2019_210_3.jpg', NULL, '20090424223851_2019_210_4.jpg', NULL, '20090424223851_2019_210_5.jpg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, NULL, '2011-07-19 14:53:54', 'sys_err5', '2012-06-25 21:47:07'),
(3512, 7263, 1, 227, '', '', 2, 1, 338000, 1.0, 10000, 3380, 2005, 26686, 0, '2009年11月', 400, NULL, '白', '★☆期間限定の大キャンペーンプライス★☆\r\n145000の大幅値引き！\r\n\r\n迫力のホワイトボディ★\r\n高年式で車体もきれい。バックレスト付です。\r\nアメリカンでクルージングを楽しんで下さい♪\r\n\r\n当店ではツーリング等多数イベントを行っています。お気軽にご来店下さい！', 0, 0, 0, NULL, '', 0, 0, '00', 0, '20090427115225_7263_187_1.jpg', NULL, '20090427115225_7263_187_2.jpg', NULL, '20090427115225_7263_187_3.jpg', NULL, '20090427115225_7263_187_4.jpg', NULL, '20090427115225_7263_187_5.jpg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, NULL, '2011-07-19 14:53:54', 'sys_err5', '2012-06-25 21:47:07'),
(3513, 15437, 2, 777, '', '', 1, 1, 510000, 1.0, 10000, 5100, 2009, 0, 0, '', 125, NULL, '白', '■新車ベース笹谷流、街乗りカスタムVer.02&lt;br&gt;\r\n■DAYTONA:ローダウンキット新品&lt;br&gt;\r\n・クロームメッキローダウンリヤショック新品&lt;br&gt;\r\n・クロームメッキショートサイドスタンド新品&lt;br&gt;\r\n・クロームメッキローダウンフロントショック／スプリング新品&lt;br&gt;\r\n■DAYTONA:バックグリップ新品&lt;br&gt;\r\n■DAYTONA:フェンダーレスキット新品&lt;br&gt;\r\n■DAYTONA:ソウルプレート&lt;br&gt;\r\n■DAYTONA:ハンドルスイッチセット新品&lt;br&gt;\r\n■KITACO:コンビニフック新品&lt;br&gt;\r\n■KITACO:フロントガーニッシュカバー新品&lt;br&gt;\r\n■HURRICANE:マスターシリンダーCAP新品&lt;br&gt;\r\n■YAMAHA:サイドバイザー新品&lt;br&gt;\r\n■KIJIMA:スポンジグリップ装着&lt;br&gt;\r\n■メッキ加工クランクケースカバー新品&lt;br&gt;\r\n■カスタムブラックスクリーン新品&lt;br&gt;\r\n■ウェーブディスクローター新品&lt;br&gt;\r\n■カスタムミラー新品&lt;br&gt;\r\n■カチ上げマフラー新品&lt;br&gt;\r\n■カスタムハンドルナローバー新品&lt;br&gt;\r\n■カスタムハンドルポスト新品&lt;br&gt;\r\n■他・・・カスタム多数&lt;br&gt;\r\n■乗り出し価格￥510,000\r\n■全国配送可能（この車両の配送費用は別途必要です）\r\n\r\n■笹谷パーツ■\r\n\r\n〒351-0112\r\n\r\n埼玉県和光市丸山台2-2\r\n\r\nTEL 0120-925-338\r\n\r\n【お知らせ】\r\n現在、東北地方太平洋沖地震の影響により、計画停電が実施されておりまして、\r\nカスタム車の組み上げ作業に支障・遅れが生じております。\r\nお客様の納車を約束通りにするために昼夜、スタッフ一同作業しておりまして、\r\nなかなか電話に出れません。\r\nまた停電中は、電話回線も繋がらなく、電気が復旧しても混線で繋がらない事例もあります。\r\n大変恐れ入りますが、車両に関するお問い合わせは、当HPの「お問合せ先」より、\r\nメールでお願いいたします。\r\n電話で直接、詳細を、お聞きなりたい方は、連絡先と都合がいい時間帯を、記入していただけましたら、\r\n当方より、お電話差し上げます。\r\n \r\n笹谷パーツPC\r\nhttp://www.ssy338.com\r\n \r\n笹谷パーツモバイル\r\nhttp://my.peps.jp/sa2901\r\n \r\n※当方のカスタム車製作は、フレーム・エンジンの状態から、一つ一つのパーツを組み上げており、\r\nまた、エンジン・クランクのO/H作業も多く、二人で作業することも多いため、電話があれば、\r\n必然的に作業を中断することになり、遅れが生じます。\r\n少人数で作業してますので、何卒、わがままを、お許し願います。\r\nまた、電話でカスタム依頼を受けた場合、双方の聞き違い等により、カスタム車が完成しても、\r\nお客様のご要望通りになっていない場合があります。\r\nメールでしたら、常にお客様からのオーダーを確認できますので、間違いが無い作業ができます。\r\nよろしく、ご協力願います。\r\n\r\n営業時間AM11:00〜PM20:00', 0, 0, 0, NULL, '', 0, 0, '00', 0, '20090425155209_15437_110_1.jpg', NULL, '20090425155244_15437_110_2.jpg', NULL, '20090425155307_15437_110_3.jpg', NULL, '20090425155329_15437_110_4.jpg', NULL, '20090425155402_15437_110_5.jpg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, NULL, '2011-07-19 14:53:54', 'sys_err5', '2012-06-25 21:47:07');
